INSERT INTO `procedure_rows` VALUES (1,3,1,1,'ISO 9001:2015 Standards','2022-11-15 04:22:59','2022-11-15 04:22:59'),(2,3,1,2,'National Commission for Science, Technology and Innovation','2022-11-15 04:23:14','2022-11-15 04:23:14'),(3,3,1,3,'KURA Science, Technology and Innovation Strategy','2022-11-15 04:23:27','2022-11-15 04:23:27'),(4,3,1,4,'KURA Operating Procedures','2022-11-15 04:23:41','2022-11-15 04:23:41'),(5,4,1,1,'DG	-        Director General','2022-11-15 04:24:04','2022-11-15 04:24:04'),(6,4,1,2,'D( PSC)             -        Director (Policy, Strategy and Compliance)','2022-11-15 04:24:22','2022-11-15 04:24:22'),(7,4,1,3,'DOC 	-	Document','2022-11-15 04:24:36','2022-11-15 04:24:36'),(8,4,1,4,'KURA	-	Kenya Urban Roads Authority','2022-11-15 04:24:50','2022-11-15 04:24:50'),(9,6,1,1,'Research and Innovation Concepts','2022-11-15 04:25:18','2022-11-15 04:25:18'),(10,6,1,2,'Research concepts schedules','2022-11-15 04:25:31','2022-11-15 04:25:31'),(11,7,1,1,'At the beginning of the Financial Year, the DD (R&I) shall request for research concepts touching on the mandate of the Authority from HODs for consolidation;','2022-11-15 04:25:49','2022-11-15 04:25:49'),(12,7,1,2,'The research concepts shall be reviewed by a research and Innovation committee established by the DG with specified roles and responsibilities to determine those that can be implemented internally or externally depending on the priority, scope, scale and costs;','2022-11-15 04:26:05','2022-11-15 04:26:05'),(13,7,1,3,'The DD (R&I) shall prepare a schedule of research concepts considering the priority, scale, scope and costs and method of execution for approval by the DG;','2022-11-15 04:26:20','2022-11-15 04:26:20'),(14,7,1,4,'Where the research and innovation concepts shall be executed internally by the department or individual, the concept shall be implemented as per the NACOSTI ethics review guidelines;','2022-11-15 04:26:37','2022-11-15 04:26:37'),(15,7,1,5,'Where the research and innovation concepts shall be executed externally by an institution or individual consultant, the terms of reference and contract for engagement shall be developed for approval by the DG and shall be handed over to the institutions or consultants for implementation;','2022-11-15 04:26:53','2022-11-15 04:26:53'),(16,7,1,6,'Upon delivery of the research outputs and innovation by the internal or external parties, the same shall be shared with the relevant users in the departments for feedback and integration in operations and functions of the authority; and','2022-11-15 04:27:07','2022-11-15 04:27:07'),(17,7,1,7,'At the close of the Financial Year, the research and innovation committee shall undertake an evaluation of the research and innovation initiatives to determine their usefulness, impacts and lessons learnt and submit a report to the DG.','2022-11-15 04:27:23','2022-11-15 04:27:23'),(18,8,1,1,'Research and Innovation terms of references','2022-11-15 04:27:46','2022-11-15 04:27:46'),(19,8,1,2,'Research and innovation contracts','2022-11-15 04:27:56','2022-11-15 04:27:56'),(20,8,1,3,'Research and Innovation prototypes','2022-11-15 04:28:09','2022-11-15 04:28:09'),(21,8,1,4,'Research and innovation reports','2022-11-15 04:28:27','2022-11-15 04:28:27'),(22,9,1,1,'Research and Innovation terms of references','2022-11-15 04:28:43','2022-11-15 04:28:43'),(23,9,1,2,'Research and innovation contracts','2022-11-15 04:30:08','2022-11-15 04:30:08'),(24,9,1,3,'Approved Research and Innovation Concepts','2022-11-15 04:30:20','2022-11-15 04:30:20'),(25,9,1,4,'Approved Research concepts schedules','2022-11-15 04:30:32','2022-11-15 04:30:32');
